import React from 'react';
import Home from './components/Home';
import View from './components/View';
import { Routes, Route} from "react-router-dom";
const App = () => {

    return (
        <>
            <Routes>
                <Rout path='/' element={<Home/>} />
                <Route path='/view' element={<View/>} />

            </Routes>
        </>
    );
};

export default App;
